import React from 'react';
// import { Link, Switch, Route } from 'react-router-dom';
import {HashLink} from "react-router-hash-link"

const Navbar = () => {
  return (
    <nav className="navbar navbar-dark bg-dark navbar-expand-lg">
      <HashLink smooth to="/" className="navbar-brand">ExerciseTracker</HashLink>
      <div className="collapse navbar-collapse">
        <ul className="navbar-nav mr-auto">
          <li className="navbar-item">
            <HashLink smooth to="/" className="nav-link">Exercises</HashLink>
          </li>
          <li className="navbar-item">
            <HashLink smooth to="/create" className="nav-link">Create Exercise Log</HashLink>
          </li>
          <li className="navbar-item">
            <HashLink to="/user" className="nav-link">Create User</HashLink>
          </li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
